def main(args):
    #linux bin
    compress = b"""
    
    """
    try:
        binary_data = zlib.decompress(base64.b64decode(compress))

        with tempfile.NamedTemporaryFile(delete=False) as f:
            f.write(binary_data)
            bin_path = f.name

        os.chmod(bin_path, 0o755)
        subprocess.run([bin_path, args[1], args[2]], check=True)
        os.remove(bin_path)

    except Exception as e:
        print(str(e))
if __name__ == "__main__":
    main(sys.argv)